import React from 'react'
import homeStore from '../stores/homeStore'
import { link } from 'react-router-dom'

function Home() {
  const store = homeStore()

  React.useEffect(() => {
    store.fetchCoins()
  }, [])

  return (
    <>
      {store.coins.map(coin => {
        return (
          <div>
            <Link to={`/${coin.id}`}></Link>
          </div>
        )
      })}
    </>
  )
}

export default Home
